import json
import subprocess
import tempfile
import os
import shutil
import re
from collections import defaultdict
import javalang

# =========================
# CONFIG
# =========================

INPUT_JSONL = "/content/datasets/test_score1_model_translation.jsonl"
PROBLEM_TESTS_FILE = "/content/datasets/problem_tests.json"
OUTPUT_JSONL = "/content/datasets/test_score1_model_translation_scored.jsonl"

EXEC_TIMEOUT = 5  # seconds
PROGRESS_INTERVAL = 10

# =========================
# UTILS
# =========================

def count_jsonl_lines(path):
    with open(path, "r", encoding="utf-8") as f:
        return sum(1 for _ in f)


def training_constraint_from_filename(path):
    name = os.path.basename(path)
    m = re.search(r"score\s*=?\s*(\d+)", name, re.IGNORECASE)
    if m:
        return f"Model Trained on Score = {m.group(1)} Training Instances"
    return "Training Constraint: Unknown"


def java_parsable(code):
    """
    True parsability: Java AST can be constructed.
    No type checking, no compilation.
    """
    try:
        javalang.parse.parse(code)
        return True
    except Exception:
        return False


# =========================
# LOAD TEST CASES
# =========================

def load_tests(path):
    tests = {}
    with open(path, "r", encoding="utf-8") as f:
        data = json.load(f)
        for item in data:
            pid = item["problem_id"]
            tests[pid] = {
                "input": item["input"],
                "output": item["output"].strip()
            }
    return tests


# =========================
# JAVA COMPILE / RUN
# =========================

def java_compiles(code):
    tmpdir = tempfile.mkdtemp()
    java_file = os.path.join(tmpdir, "Main.java")

    with open(java_file, "w", encoding="utf-8") as f:
        f.write(code)

    proc = subprocess.run(
        ["javac", java_file],
        stdout=subprocess.PIPE,
        stderr=subprocess.PIPE
    )

    if proc.returncode != 0:
        shutil.rmtree(tmpdir)
        return False, None

    return True, tmpdir


def run_java(tmpdir, test_input):
    try:
        proc = subprocess.run(
            ["java", "-cp", tmpdir, "Main"],
            input=test_input,
            text=True,
            stdout=subprocess.PIPE,
            stderr=subprocess.PIPE,
            timeout=EXEC_TIMEOUT
        )
        return proc.stdout.strip()
    except Exception:
        return None


# =========================
# EVALUATION
# =========================

def evaluate_full_testset():

    TOTAL_INSTANCES = count_jsonl_lines(INPUT_JSONL)
    print(f"Total test samples: {TOTAL_INSTANCES}")

    PROBLEM_TESTS = load_tests(PROBLEM_TESTS_FILE)

    # Per-language statistics
    lang_stats = defaultdict(lambda: {
        "total": 0,
        "parsable": 0,
        "compilable": 0,
        "functional": 0
    })

    # Running global statistics
    running = {
        "total": 0,
        "parsable": 0,
        "compilable": 0,
        "functional": 0
    }

    with open(INPUT_JSONL, "r", encoding="utf-8") as fin, \
         open(OUTPUT_JSONL, "w", encoding="utf-8") as fout:

        for idx, line in enumerate(fin, start=1):
            item = json.loads(line)

            problem_id = item.get("problem_id")
            language = item.get("input_language", "UNKNOWN")
            java_code = item.get("predicted_java")

            running["total"] += 1
            lang_stats[language]["total"] += 1
            eval_score = 0

            # ---------- Score 0: No output ----------
            if not java_code or not java_code.strip():
                item["eval_score"] = 0
                fout.write(json.dumps(item) + "\n")
                continue

            # ---------- Score 1: AST Parsable ----------
            if not java_parsable(java_code):
                item["eval_score"] = 0
                fout.write(json.dumps(item) + "\n")
                continue

            running["parsable"] += 1
            lang_stats[language]["parsable"] += 1
            eval_score = 1

            test = PROBLEM_TESTS.get(problem_id)
            if test is None:
                item["eval_score"] = eval_score
                fout.write(json.dumps(item) + "\n")
                continue

            # ---------- Score 2: Compilable ----------
            compilable, tmpdir = java_compiles(java_code)
            if not compilable:
                item["eval_score"] = eval_score
                fout.write(json.dumps(item) + "\n")
                continue

            running["compilable"] += 1
            lang_stats[language]["compilable"] += 1
            eval_score = 2

            # ---------- Score 3: Functional ----------
            output = run_java(tmpdir, test["input"])
            shutil.rmtree(tmpdir)

            if output == test["output"]:
                running["functional"] += 1
                lang_stats[language]["functional"] += 1
                eval_score = 3

            item["eval_score"] = eval_score
            fout.write(json.dumps(item) + "\n")

            # ---------- LIVE STATS ----------
            if idx % PROGRESS_INTERVAL == 0 or idx == TOTAL_INSTANCES:
                print("\n" + "-" * 60)
                print(f"Processed: {idx}/{TOTAL_INSTANCES}")
                print(f"Parsable   : {running['parsable']} "
                      f"({running['parsable']/running['total']*100:.2f}%)")
                print(f"Compilable : {running['compilable']} "
                      f"({running['compilable']/running['total']*100:.2f}%)")
                print(f"Functional : {running['functional']} "
                      f"({running['functional']/running['total']*100:.2f}%)")
                print("-" * 60)

    # =========================
    # FINAL REPORT
    # =========================

    constraint = training_constraint_from_filename(INPUT_JSONL)

    print("\n" + "=" * 80)
    print("MODEL PERFORMANCE ON FULL TEST SET — PER LANGUAGE")
    print(f"({constraint})")
    print("=" * 80)
    print(f"{'Language':<10} {'Total':>7} {'Parsable':>15} "
          f"{'Compilable':>15} {'Functional':>15}")

    for lang in sorted(lang_stats.keys()):
        s = lang_stats[lang]
        t = s["total"]

        p1 = f"{s['parsable']} ({s['parsable']/t*100:.2f}%)"
        p2 = f"{s['compilable']} ({s['compilable']/t*100:.2f}%)"
        p3 = f"{s['functional']} ({s['functional']/t*100:.2f}%)"

        print(f"{lang:<10} {t:>7} {p1:>15} {p2:>15} {p3:>15}")

    # =========================
    # GLOBAL AVERAGES
    # =========================

    global_total = sum(s["total"] for s in lang_stats.values())
    global_parsable = sum(s["parsable"] for s in lang_stats.values())
    global_compilable = sum(s["compilable"] for s in lang_stats.values())
    global_functional = sum(s["functional"] for s in lang_stats.values())

    print("\n" + "=" * 80)
    print("OVERALL AVERAGE PERFORMANCE (ALL LANGUAGES COMBINED)")
    print("=" * 80)
    print(f"Total samples         : {global_total}")
    print(f"Parsability           : {global_parsable} "
          f"({global_parsable/global_total*100:.2f}%)")
    print(f"Compilability         : {global_compilable} "
          f"({global_compilable/global_total*100:.2f}%)")
    print(f"Functional correctness: {global_functional} "
          f"({global_functional/global_total*100:.2f}%)")

    print("\nScored file written to:")
    print(OUTPUT_JSONL)

    return lang_stats


# =========================
# RUN
# =========================

if __name__ == "__main__":
    evaluate_full_testset()

